  const url =
    "https://api.privatbank.ua/p24api/pubinfo?json&exchange&coursid=5";

  const getValues = async () => {
    axios.get(url).then(function a(response) {
      return response.data;
    });
    a();
  };
  getValues();
  return <div>123123</div>;
};

export default MoneyData;
